                    secondName: "Трелони",
                    specialization: "Землевладелец",
                    isLookinForTeam: true,
                    info: "Характер отсутствует",
                    institute: "ИРИТ-РТФ",
                    direction: "Программная инженерия",
                    year: 1984,
                    skill: "Отсутствует"
                }
            ]
        }
    }
    render () {
        return (
            <div className="frames-container">
                {this.state.frames.map((frame) => (
                    <Frame 
                    key={frame.id} 
                    frame={frame} />
                ))}
            </div>
        )
    }
}

export default Frames
